import React from 'react';
import { } from 'react-native';
import styled from 'styled-components/native'
import { Rating } from 'react-native-ratings';

const SC = {
    reviewWrap: styled.View`
        flex-Direction: row;
        justify-Content: space-between;
        padding: 20;
        border-Style: 'solid';
        border-Bottom-Width: 1px;
        border-Bottom-Color: gray;
    `,
    leftWrap: styled.View`
        align-items:flex-start;
    `,

}

const ReviewEle = (props) => {
    return (
        <SC.reviewWrap>
            <leftWrap>
                <Text style={styles.writerName}>{props.nickname}</Text>
                <Rating
                    readonly={true}
                    imageSize={12}
                    startingValue={props.score}
                />
                <Text style={styles.reviewContent}>{props.content}</Text>
            </leftWrap>
            <Text style={styles.reviewDate}>{props.date}</Text>
        </SC.reviewWrap>
    )
}

export default ReviewEle;
